def get_camera_url(camid):
    r = requests.get(f"https://mdotjboss.state.mi.us/MiDrive/camera/getCameraInformation/{camid}")
    return r.json()["link"]

def list_cameras():
    for camera in cameras:
        yield {"description": camera["title"], "geo": [camera["latitude"],camera["longitude"]], "id": camera["id"], "format": get_camera_url(camera["id"])}